import React from "react"
import axios from "axios"
const Postdata = async (link, data)=>{
    try{
    const result = await axios.post(link,data);

    if(result.ok){

        return  result.data;

    }
    }
    catch(error){
        return  error;
    }

}

export default Postdata;
